import React, { useContext } from 'react';
import {BrowserRouter,Routes,Route} from 'react-router-dom';
import '../container/rightdiv.css';
import CourseHome from './CourseHome';
import PythonContent from './PythonContent';
import DsCourseContent from './DsCourseContent';
 
const Rightdiv = () => {
  return (
    <div className='right_total'>
      <div className='academy-name'>
        <p>Welcome to Skillup Academy</p>
      </div>
      <div>
        <BrowserRouter>
        <Routes>
               <Route exact path='/python' element={<PythonContent/>}></Route>
               <Route exact path='/' element={<CourseHome/>}></Route>

        </Routes>
        </BrowserRouter>
       
      </div>
     
    </div>
  );
};

export default Rightdiv;
